  // lectureId를 이용해 데이터 조회 및 화면 구성
  return (
    <div>
      <h1>Lecture Detail</h1>
      <p>Lecture ID: {lectureId}</p>
      {/* 다른 강의 세부 정보 표시 */}
    </div>
  );
}

export default LectureDetail;
